// Rule start
and start (state: LexState) lexbuf =
  match _fslex_tables.Interpret(33,lexbuf) with
  | 0 -> ( 

                            
                     match state.tokens with
                     | [] -> 
                       if state.eof then
                         failwith "eof"
                       else
                         tokenstream state lexbuf
                     | x::xs ->
                       x, {state with tokens = xs}
                   

          )
  | _ -> failwith "start"
// Rule tokenstream
