  | 1 -> ( 

                        Lex.token LPAREN state lexbuf

          )
  | 2 -> ( 

                        Lex.token RPAREN state lexbuf

          )
  | 3 -> ( 

                        Lex.token EQ state lexbuf

          )
  | 4 -> ( 

